function App() {

	function changeBackground(e) {
    e.target.style.background = 'red';
  }


  return (
    <div className="App">
			<div className="head-text" onMouseOver={changeBackground}>
				<Head/>
			</div>
      <Home/>
      <Home/>
      <Home/>
      <Home/>
    </div>
  );
}

export default App;
